$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_a2732b3fec8c6c97c57d823905e2883d'] = 'Product availability';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_53592d9b737443c24389abef4961f9d9'] = 'or the availability of the product you have two variables: \"days\" and \"availability\". Both are governed by whether the product is in stock and if it is available to order, see the \"Available for order\" on the tab Information (Catalog > Products). If you are entered product text that is displayed in your e-shop (front office), depending on whether the product is / is not available / is orderable (see card Quantities), will by use the value of these texts. Variable \"Days\" is a simpler, if the first number is find. \"Availability\" is able to distinguish numbers (the number of days for delivery) and dates (e.g. when the product will be available). You can set different values ​​for the availability of in stock / to order / sold out.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_f5c5cd16cec652fe7436c4de79c1da2a'] = 'If the product is in stock, into the feed will be inserted the first number from the text displayed in your shop as Products in stock or zero. If the product is not in stock and in the product availability is not a text, then no return value. Afterwards depending on the feed setting, if the XML tag may be empty or not.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_25ba837bddb2f3631c83835c25413539'] = 'This variable enables specify different custom values (like {condition}).​​ Default functionality is: for products that are in stock, enter the identical number as {days}. The same for products that are not in stock, but can be ordered. If product is unavailable, it does not insert in the feed at all.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_94bfc6175ca9ff03c8dd81b2b84d36e6'] = 'Customization options: enter your own values ​​in this order - \"in stock\", \"to order\" and \"sold out\". They should not start grid, which is reserved for special values​​. You can set spaces after commas for improve readability.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_6735daaa03ec6159a7e149c759151976'] = 'Examples:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_5dcd5bd6efd565fb40194d7a757ba21e'] = 'Inserts the specified text, also unavailable products are added into the feed.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_f3c3edc5d26954cd58c7c8c9015eaf0a'] = 'For products \"in stock\" will be inserted the number. For products \"to order\" either a number or formatted date (see the PHP date() function). The default behavior for unavailable products we not want to change, so can be omitted.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_e2ffb990947557f75e57b795aa17f665'] = 'If you want the products in stock yet differentiate according to delivery time, enter the number of days. If the value is less than or equal to the availability of the number of days and the value for later availability, separated by a colon. According to this example, the products in stock that will be sent within three days put the value \"immediately\" to the other products in stock will insert the value \"on the way\". For other products is placed number / date.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_5666e288aa6a0d6b71f037d1f52dac83'] = 'For products \"in stock\" is put a number of products \"on the way\" number or date. Unavailable products are not added to the feed at all (this is the default value).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_5dcdf642d65c6dbad40e438c744e1ae7'] = 'Settings for Google Merchant Center: The products will be shipped within three days including the inserted \"in stock\" for other products in stock \"available for order\". For products that are longer not in stock, but accept orders, will insert a \"preorder\". The products unavailable to put \"out of stock\".';
